import React from 'react';



const ProfilePicture = (props) => {
    return (
        <div className={s.profilePicture}>
            <div>
                <img src='https://www.w3schools.com/howto/img_snow_wide.jpg'/>
            </div>

        </div>
    )
}

export default ProfilePicture;
